import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState(null);

  // Fetch the JSON from your Python backend
  useEffect(() => {
    fetch('http://localhost:5001/api/output')
      .then((response) => response.json())
      .then((jsonData) => {
        setData(jsonData);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  // Always call the hook; then check for data inside
  useEffect(() => {
    if (!data) return;

    // Define the event handler once so we can remove it later
    const toggleAccordion = (header) => {
      header.classList.toggle('active');
      const content = header.nextElementSibling;
      if (content) {
        content.classList.toggle('show');
      }
    };

    const accordionHeaders = document.querySelectorAll('.accordion-header');
    // Store the event listeners so we can remove them
    accordionHeaders.forEach((header) => {
      // Save the reference function for removal
      const handler = () => toggleAccordion(header);
      header.addEventListener('click', handler);
      // Attach the handler reference to the header element (for cleanup)
      header._toggleHandler = handler;
    });

    // Cleanup: remove event listeners on unmount
    return () => {
      accordionHeaders.forEach((header) => {
        if (header._toggleHandler) {
          header.removeEventListener('click', header._toggleHandler);
        }
      });
    };
  }, [data]);

  // If no data, show a loading message
  if (!data) {
    return <div>Loading...</div>;
  }

  // Safely parse JSON strings; if not available, fallback to empty objects
  let callSummaryOutput = {};
  try {
    callSummaryOutput = data?.call_summary?.output
      ? JSON.parse(data.call_summary.output)
      : {};
  } catch (err) {
    console.error('Error parsing call_summary:', err);
  }
  const summary = callSummaryOutput.summary || 'No summary available';
  const rating = callSummaryOutput.rating || 0;

  let customRagAnalysisOutput = {};
  try {
    customRagAnalysisOutput = data?.custom_rag_analysis?.output
      ? JSON.parse(data.custom_rag_analysis.output)
      : {};
  } catch (err) {
    console.error('Error parsing custom_rag_analysis:', err);
  }
  const convBalance = customRagAnalysisOutput['Conversational Balance'] || 'N/A';
  const objectionHandling = customRagAnalysisOutput['Objection Handling'] || 'N/A';
  const pitchOptimization = customRagAnalysisOutput['Pitch Optimization'] || 'N/A';
  const callToActionExecution = customRagAnalysisOutput['Call-to-Action Execution'] || 'N/A';

  let buyerIntentOutput = {};
  try {
    buyerIntentOutput = data?.buyer_intent?.output
      ? JSON.parse(data.buyer_intent.output)
      : {};
  } catch (err) {
    console.error('Error parsing buyer_intent:', err);
  }
  const buyerIntentNlp = buyerIntentOutput.nlp || 'N/A';

  let profanityCheckOutput = {};
  try {
    profanityCheckOutput = data?.profanity_check?.output
      ? JSON.parse(data.profanity_check.output)
      : {};
  } catch (err) {
    console.error('Error parsing profanity_check:', err);
  }
  const severityLevel = profanityCheckOutput['severity level'] || 'N/A';
  const profanityReport = profanityCheckOutput['report'] || 'N/A';

  return (
    <div className="container">
      {/* TOP BAR */}
      <div className="top-bar">
        <div className="logo">Call Insights</div>
      </div>

      {/* CONTENT WRAPPER */}
      <div className="content">
        {/* LEFT SIDEBAR */}
        <div className="sidebar">
          <h2>Call Rating</h2>
          <div className="match-rate-circle" data-percentage={rating}>
            <span className="percentage">{rating}%</span>
          </div>

          <div className="sidebar-section">
            <h4>Buyer Intent</h4>
            <p>
              <strong>Predicted:</strong>{' '}
              <span style={{ color: 'green' }}>{buyerIntentNlp}</span>
            </p>
          </div>

          <div className="sidebar-section">
            <h4>Profanity Detection</h4>
            <p>
              <strong>Severity Level:</strong> {severityLevel}
            </p>
            <p>{profanityReport}</p>
          </div>
        </div>

        {/* MAIN SECTION */}
        <div className="main-section">
          <div className="section-card">
            <h3>Call Summary</h3>
            <p>{summary}</p>
            <h3>Overall Call Score: {rating}/100</h3>
          </div>

          <div className="section-card">
            <div style={{ display: 'flex', flexWrap: 'wrap', gap: '2rem' }}>
              <div style={{ flex: 1 }}>
                <h3>Strengths</h3>
                <ul>
                  <li>
                    <strong>Strong opening:</strong> John's introduction is clear,
                    concise, and relevant to Michael's company.
                  </li>
                  <li>
                    <strong>Good discovery questions:</strong> John asks
                    open-ended questions to understand Michael's current pain points
                    and challenges.
                  </li>
                  <li>
                    <strong>Effective presentation of value:</strong> John clearly
                    explains how CloudSync's solution addresses Michael's concerns
                    and provides specific benefits.
                  </li>
                  <li>
                    <strong>Professional tone and language:</strong> The conversation
                    is polite, friendly, and free of jargon or overly technical terms.
                  </li>
                </ul>
              </div>
              <div style={{ flex: 1 }}>
                <h3>Areas for Improvement</h3>
                <ul>
                  <li>
                    <strong>Lack of depth in discovery:</strong> While John asks good
                    questions, he could have dug deeper to understand Michael's
                    specific needs and goals.
                  </li>
                  <li>
                    <strong>No clear next steps:</strong> Although John schedules a
                    follow-up call, he doesn't explicitly outline what Michael can expect.
                  </li>
                </ul>
              </div>
            </div>
